import { createSelector, createFeatureSelector } from '@ngrx/store';
export const selectVideoPlayerHistoricalState = createFeatureSelector('videoPlayerHistoricalState');
export const selectVideoPlayersHistorical = () => createSelector(selectVideoPlayerHistoricalState, state => state.videoPlayersHistorical);
export const selectVideoPlayerHistorical = id => createSelector(selectVideoPlayerHistoricalState, state => state.videoPlayersHistorical.find(d => d.id === id));
